    "content": "{'status': 'ok', 'data': [{'title': 'Italian Pasta And Bean Soup Mix', 'ingredients': '1/2 c Dried pinto beans|1/2 c Dried pink beans|1/2 c Dried kidney beans|1 c Small egg pasta bows|1 Dried parsley|1 Instant chicken broth; granules|1 ts Dried rosemary|1 ts Dried basil|1 ts Salt|1/2 ts Dried minced garlic|1/4 ts Crushed red pepper', 'servings': '1 servings', 'instructions': '1. Place beans into a 3 1/2 cup jar (layer or mix altogether) with a tight-fitting lid. 2. Place pasta ina zip-loc baggie and place on top of the beans. 3. Mix remaining ingredients in a small bowl and place in a small zip-loc baggie. Attach the following recipe: Italian Pasta and Bean Soup Mix Rinse and pick over beans. Place into a 5-quart Dutch oven with 3 cups water. Cover, bring to a boil and boil 2 minutes. Remove from heat, cover and let soak for 1 hour. Drain. Add 8 cups water, 1 can (28-ounces) crushed tomatoes, seasoning packet and 1 cup coarsely chopped carrot, celery and onion. Bring to a boil, reduce heat to low, cover and simmer for 2 hours or until beans are tender-firm. Uncover, increase het to medium-low and boil gently for 35 minutes, stirring until soup has thickened slightly. Stir in pasta, increase heat to medium and cook 10 minutes longer or until pasta is tender.'}, {'title': 'Italian Pasta Supreme', 'ingredients': '3 c Pasta; cooked and drained|1 c 100% grated parmesan cheese|1 c Kraft house Italian dressing|1/2 Red pepper chopped|1/2 Red onion; sliced|2 c Broccoli flowerets|1/2 c Black olives; sliced', 'servings': '6 servings', 'instructions': \"Combine tri-coloured rotini, fusilli or whatever pasta you're using with all other ingredients in a salad bowl. Toss gently to mix. Chill. Per serving: 220 Calories (kcal); 2g Total Fat; (8% calories from fat); 8g Protein; 42g Carbohydrate; 0mg Cholesterol; 109mg Sodium Food Exchanges: 2 1/2 Grain(Starch); 0 Lean Meat; 1/2 Vegetable; 0 Fruit; 0 Fat; 0 Other Carbohydrates\"}, {'title': 'Italian Pasta Bake', 'ingredients': '1 lb Ground beef or Italian sausage|4 c Mostaccioli; cooked, drained|1 Jar; (28 oz) spaghetti sauce|3/4 c Kraft 100% grated parmesan cheese; divided|2 c Kraft hearty italian style shredded cheese', 'servings': '1 Servings', 'instructions': 'Brown meat in large skillet; drain. Stir in mostaccioli, sauce, and 1/2 cup of the parmesan cheese. Spoon into 13X9 baking dish. Sprinkle with shredded cheese and remaining 1/4 cup parmesan cheese. Bake at 375 degrees for 20 minutes. Makes 6 servings. Note: It says it makes 6 servings, but there are 4 in my family and there was still half left when we finished. Also, I used the hamburger meat instead of the sausage.'}, {'title': 'Italian Pasta Chips', 'ingredients': 'Olive oil cooking spray|12 Won ton skins|1 lg Egg white|1/2 ts Dried oregano|3/4 c Shredded Pecorino or|Parmigiano-Reggiano cheese', 'servings': '4 Servings', 'instructions': 'Place rack in center of oven, preheat oven to 400 F. Spray cookie sheet with olive oil. Lay wonton skins on sheet in single layer. Put egg white in a bowl and froth with a fork. Brush each wonton skin with egg white and sprinkle with oregano and 1 tablespoon cheese. Spray again with olive oil. Cut each in half diagonally with pizza cutter. Bake until edges are brown, about 6 to 7 minutes. Transfer to a rack to cool. Can be stored in an airtight container at room temperature for a few days. Makes 8 (3 chip) servings. Per serving: Calories 55 Fat 3g Cholesterol 6 mg Sodium 178mg Percent calories from fat 46'}, {'title': 'Italian Pasta Fajoile', 'ingredients': '1 lb Spaghetti, uncooked|3 qt Water|2 tb Salt|1/4 c Olive oil|2 md Onion|28 oz Tomato canned, crushed|1 ts Tomato paste|1 ts Pepper|16 oz White kidney (cannelli)|Beans', 'servings': '4 Servings', 'instructions': \"Break spaghetti into 1 1/2inch pieces. In a deep skillet saute' onions in olive oil until translucent and brown. Add tomatoes, tomato paste and pepper. Lower heat to simmer and cook slowly for 20 minutes. Bring 3 qts water to full boil. Add 2 Tbs salt and cook pasta al dente. Add beans to cooking sauce and cook a few more minutes. Start draining the spaghetti but reserve the liquid. Now add back liquid until pasta and spaghetti are equal level in pot. Now add the sauce while stirring. You can adjust the amount of liquid to desired consistency. Careful not to add too much or flavor will be diluted. Add some black pepper to taste.\"}, {'title': 'Italian Pasta Salad', 'ingredients': 'Cooked spaghetti|Pepperoni; cut in half|Mozzarella cheese; cubed|Fresh mushrooms; quartered|Broccoli; flowerets|Carrots; julienned|Sliced black olives; drained|Berstiens Garlic Cheese Italian dressing|OR 2 packages Good Seasons dressing', 'servings': '1 Servings', 'instructions': 'Cook the spaghetti. Rinse and drain. Set aside to cool. Prepare all of the other ingredients. Combine with spaghetti and add dressing. Refrigerate for several hours before serving to let marinate. Note: This is the way I received the recipe, with no amounts. You just make how much you want, and put in how much you want. This salad is excellent. As for the salad dressing, sometimes this Bernsteins is hard to find here, so there are several Good Seasons packages to combine to get the same effect.'}, {'title': 'Italian Pasta Sauce', 'ingredients': '1 lb Hamburger|1/2 c Sliced mushrooms and liquid|1 c Chopped onion|1 ts Oregano|1 lg Crushed garlic clove|1/2 ts Basil|3 1/2 c Whole peeled tomatoes|1 ts Salt|2/3 c Tomato paste|1/8 ts Pepper|1/2 c Water', 'servings': '4 Servings', 'instructions': 'Brown ground chuck or hamburger with onion and garlic in large saucepan. Drain off fat. Add remaining ingredients. Stir to break up tomatoes. Boil gently, uncovered 1 hour. Stir occasionally. Serve over hot cooked pasta. :'}, {'title': 'Italian Pasta Stir-Fry', 'ingredients': '8 oz Linguine -- cooked|1 md Zucchini -- sliced|1 md Onion -- chopped|2 md Tomatoes -- peel/seed/chop|1/4 c Fresh parsley -- snipped|1 tb Olive oil|2 lg Garlic cloves -- pressed|1 ts Dried basil|1 ts Dried oregano|1/8 ts Salt|1/8 ts Ground black pepper|1/4 c Parmesan cheese -- grated', 'servings': '6 Servings', 'instructions': 'Cook pasta according to package directions. Keep warm. Slice zucchini with Grater-Slicer. Chop onion and tomatoes with Food Chopper. Snip parsley using Kitchen Cutters. Heat olive oil in Stir-Fry Skillet. Press garlic with Garlic Press into Skillet . Stir-fry 15 seconds. Add zucchini and onion. Stir-fry 2-3 minutes, until crisp tender. Add tomatoes, parsley and seasonings to Skillet. Gently stir 1-2 minutes or until thoroughly heated. Remove from heat. Stir in warm pasta and Parmesan cheese. Serve immediately. : The Pampered Chef'}, {'title': 'Bring-Along Italian Pasta Salad', 'ingredients': '16 oz Shell pasta; cooked and drained|16 oz Italian salad dressing, low calorie|1 c Chopped green bell pepper|1 c Sliced black olives; pitted|1 c Sliced pepperoni|1/2 c Grated Parmesan Cheese|2 ts Dried oregano', 'servings': '8 Servings', 'instructions': 'MIX all ingredients. Refrigerate. Makes 8 servings.'}, {'title': 'Zesty Italian Pasta-Bean Bake', 'ingredients': '1/4 c Margarine; divided|1 lg Onion; sliced|1 Clove garlic; minced|1/2 md Green pepper; chopped|1 c Sliced mushrooms|1 cn Kidney beans; (19 oz), undrained|1 1/2 c Macaroni; cooked|1 cn Tomato sauce; (14 oz)|1/4 ts Oregano|1/4 ts Pepper|1/2 ts Salt|1/2 c Coarse bread crumbs|2 tb Parmesan cheese; grated', 'servings': '1 Servings', 'instructions': 'In a medium skillet, melt 2 tbsp margarine; saute onion, garlic, green peppers and mushrooms. Stir in kidney beans, pasta, tomato sauce, orgeano, pepper and slat. Place in a greased 6 cup casserole dish. In a small bowl, toss bread crumbs and cheese with remaining melted margarine. Sprinkle over casserole. Bake uncovered at 350 F for 20 minutes'}]}",
