  {
    "role": "tool",
    "name": "v1_recipe",
    "content": "{'status': 'ok', 'data': [{'title': 'Top Rankin Desserts - 3 Points Each', 'ingredients': '225 g Icing sugar; plus extra to dust|1 Egg white and 2 egg yolks|Juice 1 1/2 lemons; plus finely grated|1 Lemon; zest of|450 g Genoa cake|250 g Marzipan|150 ml Damson wine|85 g Caster sugar; plus 2 tbsp|125 g Blueberries|25 g Butter; plus 25g/1oz butter, melted|2 Apples; peeled, quartered and cored|600 ml Double cream|1 Lime; juice of|2 tb Greek yoghurt', 'servings': '2 servings', 'instructions': \"Preheat oven to 220c/452f/Gas 7. 1 For the Cakes: Beat 225g/8oz icing sugar, egg white and juice 1/2 lemon to make a thick icing. 2 Slice the cake in half horizontally and cut out six rounds using a fluted cutter - retain the remaining cake. Roll out the marzipan thinly, then use the same cutter to cut out six rounds, retaining remaining marzipan. 3 Place a disc of marzipan on top of each piece of cake and coat them all in royal icing. Serve on a plate and dust with icing sugar. 4 For the Compote: Heat the damson wine in a pan with 25g/1oz caster sugar until the sugar has dissolved. Retain 2 tbsp blueberries and add the rest to the pan. Simmer gently until the blueberries begin to burst. 5 For the Roasted Apples: Heat 25g/1oz caster sugar and 25g/1oz butter in an ovenproof saute pan. Add the apples and saute for 1-2 minutes, transfer the pan to the oven and cook for 5-6 minutes or until the apples are tender and caramelised. 6 For the Fool: Whip 300ml/ 1/2 pint double cream with the lemon zest and 2 tbsp caster sugar until soft peaks, then gradually fold in the remaining lemon and lime juice - don't add too much juice or the mixture may curdle. 7 Spoon half the mixture into a tall glass and sprinkle over half the reserved blueberries. Top with the remaining cream mixture and the rest of the blueberries. Dust with icing sugar and add a spoonful of compote. 8 For the Christmas Puddings: Crumble the remaining Genoa cake and chop up 25g/1oz marzipan. Whisk together 300ml/ 1/2 pint double cream, egg yolks and 25g/1oz caster sugar and stir in the cake crumbs and marzipan. Grease two ramekin dishes with melted butter, then fill with mixture. 9 Cover the dishes with clingfilm and pierce a hole in each. Cook in the microwave on High/800W for 5-6 minutes, or until just set. Allow to stand, then turn the puddings out onto plates. 10 Spoon the compote on top of one pudding and serve the remaining pudding with the roasted apples and yoghurt. Dust with icing sugar. NOTES : Chef - Paul Rankin\"}, {'title': 'Bourbon Sauce for Desserts', 'ingredients': '1/2 c Butter (at room temp.)|1 c Sugar|4 Egg yolks, beaten|Pinch of salt|1 c Cream, heated|1/2 c Bourbon', 'servings': '3 Servings', 'instructions': '1. In a small bow, with a hand mixer or whisk, cream butter and sugar. 2. Transfer to the top of a double boiler and place over, but not touching simmering water. Beat in egg yolks an salt. Slowly add hot cream and stir until thickened. Add Bourbon and stir until an even consistency is obtained. Keep warm. 3. Serve over any dessert pudding, ice cream, or poundcake.'}, {'title': 'Wondrous Lowfat Vanilla Sauce for Desserts', 'ingredients': '1/2 c Sugar|1 c Boiling water|1 tb Cornstarch|2 tb Diet unsalted margarine|1 ts Pure vanilla flavoring|1 pn Salt', 'servings': '1 Servings', 'instructions': 'Combine sugar and cornstarch, then gradually stir in the boiling water, stirring for 5 minutes on low heat. Remove from heat and add margarine, vanilla and salt. Serve over Angel Food Cake, lowfat custards and puddings, fat-free pastries, fruit gelatins or fresh fruit, especially bananas, mangos, and other non-citrus fruits. Makes about 1 1/2 cups.'}, {'title': 'Lemon Sauce for Desserts', 'ingredients': '1 c Sugar|2 tb Cornstarch|2 c Cold water|1/4 c Unsalted butter|1/4 c Fresh lemon juice|3 tb Lemon peel -- grated', 'servings': '6 Servings', 'instructions': '1. Combine the sugar and cornstarch in a saucepan. Slowly add the cold water and mix well. Bring mixture to a boil, then add butter, lemon juice and grated lemon peel. 2. Continue to boil slowly until the sauce is thick and opaque. This will take about 10 minutes. Cool, chill if desired, and serve over your choice of desserts. Yield: 3-1/2 cups of sauce. : Jo Anne Merrill'}, {'title': 'These Are Just Peachy Desserts', 'ingredients': '1 411 gram can peach slices in syrup|5 tb Raspberry jam|2 Plain Victoria sponge cakes|1 Orange; peeled and sliced|3 tb Caster sugar; plus 225g/8oz|150 ml Double cream; whipped|4 Red and green dessert pears|1 Lemon|300 ml White wine|Seeds from 1 vanilla pod|1 Tub vanilla ice cream|55 g Butter|2 tb Demerara sugar|75 ml Red wine|3 Egg whites|Icing sugar; to dust', 'servings': '2 servings', 'instructions': \"Preheat oven to 230c/450f/Gas 8. 1 Drain the peaches, keeping the syrup. For the Jam Sauce: Mix 4 tbsp raspberry jam and 2 tbsp reserved peach syrup. 2 Scoop out the middle of one sponge to make a 'nest'. Fill the hollow with the orange slices, sprinkle over 2 tbsp caster sugar and top with the cream. 3 Cut half the peaches in half lengthways, use to decorate the top and dust with icing sugar. Use a cutter to cut out two hearts from the remaining sponge, retaining the trimmings. 4 For the Poached Pears: Peel 2 pears and use a small sharp knife to cut away some of the core through the base. 5 Thinly peel the lemon, place the zest in a pan with the white wine and 55g/2oz caster sugar and simmer. Add the peeled pears and vanilla seeds and poach for 5-8 minutes, or until tender. 6 Serve the pears on a plate with a scoop of ice cream, drizzle over some of the jam sauce and decorate with a few peach slices and sponge hearts. 7 For the Caramelised Pear: Peel and quarter one pear and cut out the core. Cut the pear into slices, place on a non-stick baking sheet and sprinkle over 1 tbsp caster sugar. 8 Use a blow torch or place under a hot grill to caramelise. Arrange the pear slices on a plate and serve with scoops of ice cream. 9 For the Baked Pear: Cut the remaining pear into quarters and cut out the core. 10 Heat the butter in an ovenproof frying pan, add the pear quarters, sprinkle over the demerara sugar and fry for about three minutes, or until golden. 11 Pour in the red wine, bring to a simmer and transfer the pan to the oven to cook for another 4-5 minutes, or until the pears are tender. 12 For the Baked Alaska: Place a large cooking ring on a non-stick baking sheet and fill with sponge trimmings. 13 Spread 1 tbsp raspberry jam over the top and cover with the remaining peach slices. Whisk together the egg whites and 175g/6oz caster sugar until stiff. 14 Fill a small pudding mould with ice cream and turn out on top of the peaches and sponge. Pipe the meringue over the top to completely enclose the ice cream and bake in the oven for a few minutes until golden brown. Serve immediately and drizzle over the jam sauce. NOTES : Chef - Paul Rankin\"}, {'title': 'No Bake Cheese Cake Desserts', 'ingredients': '(up to)|12 Dessert dishes or cups|2 Eggs; separated|2 Envelopes unflavored gelatin|1 c Sugar|1/4 ts Salt|1 ts Grated lemon peel|3 c Creamed cottage cheese|1 tb Lemon juice|1 ts Vanilla extract|1 c Heavy or whipping cream|1/2 c Chopped nuts; about|1/4 c Chocolate sprinkles', 'servings': '12 Servings', 'instructions': '2. Stir yolk mixture into gelatin mixure. Cook over medium heat, stirring, until mixture thickens and coats spoon. 3. remove from heat, add lemon peel. cool. Into large bowl, press cottage cheese through sieve or ricer with small grid, add lemon juice and vanilla. 4. Add gelatin mixture. chill about 30 minutes, stirring, until mixture mounds when dropped from spoon. 5. In small bowl with mixer at high speed, beat egg whites just until stiff peaks form. Spoon onto gelatin mixture. 6. Beat cream until soft peaks form, spoon onto egg whites. Fold egg whites and cream into gelatin mixture. 7. Pour gelatin mixture in equal amounts into each of the dessert dishes or cups. 8. Sprinkle with chocolate sprinkles and crushed nuts. 9. refridgerate until firm., if leaving for more than 24 hrs. cover each cup or dish with plastic wrap 10. get a spoon and enjoy, Recipe Archive - 5 August 96'}, {'title': 'Delicious Christmas Desserts - French Yule Log', 'ingredients': '3 lg Eggs|4 oz Caster sugar|3 1/2 oz Plain flour|1/2 oz Cocoa powder|1 oz Butter|1 tb Hot water|1 500 gram tin sweetened chestnut puree|8 oz Chocolate buttercream icing|1 tb Icing sugar', 'servings': '8 servings', 'instructions': \"Preheat oven to Gas Mark 5/375F/190C. Grease and line a 13 in x 9 in Swiss roll tin with greased silicone paper. Sift the flour and cocoa onto plate; set aside in warm place. Melt butter. Using an electric mixer, whisk the eggs and caster sugar in a heatproof bowl until well-blended. Place the heatproof bowl over large pan of hot water. Continue whisking until egg mixture is pale and leaves a trail when the whisk is lifted. Re-sift the flour/cocoa mixture. Using a metal spoon, fold into egg. Fold in melted butter. Fold in 1 tbsp hot water. Pour the mixture into a lined Swiss roll tin. Bake for 10 minutes until the cake feels firm when pressed gently. Place sheet of greaseroof paper on a damp tea-towel. Sprinkle paper with caster sugar. Turn the baked cake straight from the oven onto the sugared paper. Remove the lining paper from the cake. Trim off cake's crusty edges. Roll up the cake from a short side. Cover with the damp tea-towel and set aside to cool. Uncover and unroll the cake. Spread with chestnut puree. Roll up the cake carefully over puree. Place on serving dish. Spread with chocolate icing. Lightly dust with sifted icing sugar. NOTES : Try this yummy French Christmas cake.\"}, {'title': 'Desserts', 'ingredients': '1/3 c Smooth peanut butter|1/3 c Dark corn syrup|2 c Crushed cornflakes; (measured after crushing)|1 pt Vanilla ice cream; softened|Chocolate sauce; (see below), optional|Whipped cream; optional|1/2 c Chopped pecans or walnuts; optional', 'servings': '1 servings', 'instructions': 'TO MAKE THE CRUST: With a fork combine the peanut butter and corn syrup, then gradually incorporate the cornflakes. When the mixture becomes hard to handle, combine the crust with your hands. Pat it down and up the sides of a 9-inch pie plate. TO MAKE THE PIE: Pat the softened ice cream in the crust. Smooth the top with a rubber spatula. Wrap the pie with plastic wrap and freeze it for at least 2 hours or until the ice cream is frozen solid. TO SERVE: Dip a knife into hot water and slice the pie into servings. Top with chocolate sauce, whipped cream and chopped nuts.'}, {'title': 'Liqueur-Flavored Desserts', 'ingredients': '*** NON NE *****', 'servings': '1 Servings', 'instructions': \"CAKES: Add Orange Brandy Cordial, Sour Cherry Vodka, or any of the raspberry cordials to flavor chocolate cake; Hazelnut liqueur, Almond Liqueur, or Coffee Liqueur to flavor sponge cakes; and, of course, Orange Brandy Cordial to flavor orange cake. Almond Liqueur is a nice touch in flourless chocolate cake recipes that call for almonds. After a cake has baked - and is still warm and still in the pan - poke holes across the top with a tester or toothpick. Pour about 2 ounces of liqueur over and allow it to drip down into the cake. Don't forget the possibilities of flavoring frostings with liqueurs; adding a little Coffee Liqueur to chocolate, for example, makes a mocha frosting. BROWNIES: Infuse a batch of fudge brownies with Almond Liqueur following the directions above for cakes. PIES: Apple pie is better than Mom's when you first toss the apples in 1/2 cup Orange Brandy Cordial, and berry pies of all persuasions benefit from tossing the berries in 1/2 cup Raspberry Vodka Cordial, Raspberry Brandy Cordial, or a blend of the two. FRESH FRUIT: Everybody's favorite, strawberries, takes on a new dimension when macerated (soaked) for 2 hours in Orange Brandy Cordial. For fruit compote, add a jigger of Blackberry or Raspberry (Vodka or Brandy) Cordial for every 6 cups of fruit and top with a generous dollop of Creme Fraiche.\"}, {'title': 'Cake/ice Cream Desserts From a Freezer Tray', 'ingredients': '1 1/2 Tablesp. sherry, and another 1/2 pt. ice cream. Freeze. Serve sliced,', 'servings': '6 Servings', 'instructions': 'The freezer tray of your automatic refrigerator makes wonderful cake-and-ice-cream specialties in jig time. FROZEN LADYFINGERS: Pack tray two thirds full with vanilla ice cream. Split ladyfingers, sprinkle generously with rum- arrange crosswise, with flat sides down, on ice cream. Freeze. Before serving, spread generous layer whipped cream over ladyfingers. Serve sliced. BUTTERSCOTCH-ALMOND ICE-CREAM CAKE: Line bottom of tray with strips of bakers\\' poundcake. Spread with 1 pt. vanilla, coffee, or chocolate ice cream. Freeze. Serve sliced, with butterscotch sauce and toasted almonds. CHOCOLATE CHARLOTTE: Slice 8 spongecake layer crosswise into 1/4\"-thick slices. Use to line bottom and sides of tray. Sprinkle with 2 tablesp. sherry; then spread with 1/2 pt. chocolate ice cream. Top with rest of cake, with whipped cream. Makes 6 servings. FREEZER-TRAY TRIFLE: In tray, alternate layers of spongecake strips with layers of vanilla, coffee, chocolate, butter-pecan, or strawberry ice cream, ending with cake. Sprinkle with 1/4 cup rum. Freeze. Serve sliced with crushed berries and bottled eggnog sauce or custard sauce flavored with rum.'}]}",
