    "role": "tool",
    "name": "v1_recipe",
    "content": "{'status': 'ok', 'data': [{'title': 'Elegant Salmon Florentine', 'ingredients': '1 ts Dried tarragon leaves|1/2 c Dry white wine; or chicken broth|3/4 lb Fresh or frozen salmon fillets; thawed|1/4 c Whipping cream|1 pk (1 pound) Green Giant Pasta Acdents Florentine froz. veget/pasta|Salt and pepper; to taste', 'servings': '4 Servings', 'instructions': 'In large skillet, combine tarragon and wine; add salmon. Bring to aboil over Medium-High heat. Reduce heat to Low; cover and simmer 5-8 minutes or until salmon flakes easily with fork. With slotted spoon, remove salmon from skillet. Set aside. Add cream to skillet; blend well. Add vegetables and pasta; mix well. Cover; cook over Medium heat for 5-8 minutes or until vegetables and pasta are tender, stirring occasionally. Meanwhile, break or cut salmon into 1 inch pieces; discard skin. Add salmon to cooked vegetables and pasta; stir in gently. Cover; cook 1 minute or until thoroughly heated. Add salt and pepper to taste. Makes 4 (1 cup serving.) NOTES : Delicious!!!! This would serve 4 if salad, bread and soup were part of the meal. Otherwise, I think it serves 3. It would make an excellent company dish, but for 4-6 people, I would double the recipe.'}, {'title': \"Emeril's Barbecue Salmon with Andouille and Potato Hash\", 'ingredients': '3 tb Olive oil|3 oz Andouille sausage; finely chopped|1/2 c Chopped yellow onions|2 ts Chopped garlic|Salt|Freshly ground black pepper|1/2 c Fresh tomatoes; peeled, seeded and chopped|2 c Cubed potatoes; blanched until fork tender|1 c Veal reduction|2 tb Chopped green onions|4 Salmon fillets; each 6 ounces|1 1/4 c Sweet barbecue sauce|1/2 c Flour|1 Onion; cut into thin rings|2 c Vegetable oil|1 c Worcestershire sauce|1 tb Finely chopped parsley', 'servings': '4 Servings', 'instructions': 'In a saut\\x82 pan, heat 1 tablespoon olive oil. When the oil is hot, add the andouille sausage and render for 3 minutes. Add the onions and saut\\x82 for 2 minutes. Add the garlic and tomatoes and saut\\x82 for one minute. Season with salt and pepper. Add the potatoes and cook for 2 minutes. Add the veal reduction. Bring the liquid up to a boil. Reduce the sauce to a simmer and cook for 3 to 4 minutes. Remove from the heat, stir in the green onions and keep warm. Season the salmon fillets with salt and pepper. In a saut\\x82 pan, heat the remaining olive oil. When the oil is hot, sear the salmon for 2 to 3 minutes on each side for medium rare. Remove the pan from the heat and brush each fillet with a tablespoon of the barbecue sauce. Season the flour with salt and pepper. Dredge the onions in the seasoned flour. In a sauce pan, heat the vegetable oil. When the oil is hot, add the onions and fry until crispy and golden brown, about 2 to 3 minutes, stirring constantly. Remove from the oil and drain on paper towels. Season the onions with salt and pepper. To assemble, spoon about 1/4 cup of the sauce in the center of each plate. Spoon 1/2 cup of the hash in the center of the sauce. Lay the salmon fillet directly on top of the hash and spoon the Worcestershire sauce over the fish. Garnish with the fried onions and parsley. Yields: 4 main-course servings'}, {'title': 'Fresh Halibut Baked with Smoked Salmon', 'ingredients': '1/8 lb Kippered salmon (soft-smoked) cut in 1/4\" strips|2 tb Lemon juice|4 tb Sherry|2 lb Halibut steak, 1\" thick|4 oz Butter|2 tb Coarsely chopped walnuts (optional)|Pepper', 'servings': '1 Recipe', 'instructions': 'Melt butter in skillet over medium flame; when very hot but not smoking, brown steaks quickly, 2 minutes on each side; add lemon juice and sherry; season with pepper to taste; heat 1 minute only; remove from heat. Place halibut in shallow glass dish; pour pan juices over; garnish with nuts and smoked salmon. Bake at 350 for 10 minutes or until fish flakes with a fork.'}, {'title': 'Fresh Salmon Pate', 'ingredients': '1 1/2 lb Boned and skinned salmon|1 ts Salt|1 ts Ground white pepper|1/2 ts Ground cloves|1/2 ts Ground mace or nutmeg|1/2 ts Ground bay leaves|1/2 lb Butter|Fresh lemon juice|Chopped parsley or chives for decoration', 'servings': '4 Servings', 'instructions': 'Check that as many bones as possible really have been removed, then put the salmon into a large saucepan of cold water with a pinch of salt and a squeeze of lemon juice. Bring it to the boil, then turn the heat down and poach gently for 10 to 15 minutes - one large piece of salmon will take longer than a couple of smaller pieces. Turn off the heat and allow to cool in the water for another 10 minutes. If the skin is still on, you will find it lifts away effortlessly at this point. Put the salmon into a big bowl and mash it with a fork, or use a food processor. gently melt the butter in a saucepan and add to it all the other seasonings - the ground bayleaves, white pepper, cloves, mace or nutmeg and the salt. Stir thoroughly and pour it into the salmon. If you are using a food processor, give it another quick whizz, otherwise stir with a fork until it is thoroughly amalgamated. If you want to serve the salmon pate in slices, spoon the mixture into a loaf shaped container lined with cling film, otherwise put it into a round bowl of souffle dish. Smooth the top and sprinkle with a little parsley or chives for a lovely contrasting colour, and chill in the fridge for at least four hours. Serve with lots of crusty french bread.'}, {'title': 'Fresh Salmon with Tricolored Peppercorn Sauce', 'ingredients': '1/2 Fresh lemon|Salmon steaks or fillets - (to serve 4)|1/3 Stick butter*|1 ts Dijon mustard|1 ts Fresh lemon juice|1 tb Tricolored peppercorns - finely crushed|1 tb Fresh dill; finely chopped', 'servings': '4 Servings', 'instructions': \"*No substitutions. Squeeze juice from lemon half over salmon and barbecue or broil. Don't overcook. Melt butter; mix in mustard and lemon juice. When salmon is done, sprinkle evenly with crushed peppercorns, add dill, and drizzle melted butter sauce over all. Serve immediately.\"}, {'title': 'Fresh Thyme, Orange, and Black Pepper Salmon', 'ingredients': '1 ts Vegetable oil|4 Salmon steaks, (4-ounce) (1 inch thick)|2 ts Minced fresh thyme|1 ts Grated orange rind|1/4 ts Salt|1/4 ts Coarsely ground pepper|1 Clove garlic, crushed|Fresh thyme sprigs, (optional)|Orange rind strips, (optional)', 'servings': '4 Servings', 'instructions': 'Spread oil over the bottom of a shallow baking dish; add salmon, turning to coat. Combine 2 teaspoons thyme and next 4 ingredients; stir well. Rub fish with thyme mixture; cover and marinate in refrigerator 1 hour. Bake at 400 deg for 18 minutes or until fish flakes easily when tested with a fork. Yield: 4 servings (serving size: 3 ounces fish). Per serving: 209 Calories; 7g Fat (31% calories from fat); 34g Protein; 0g Carbohydrate; 88mg Cholesterol; 247mg Sodium NOTES : Garnish with thyme sprigs and orange rind strips, if desired.'}, {'title': 'Grannies Salmon Yorkshire Pudding with Onions', 'ingredients': '340 g Fresh fillet of salmon; (12oz)|225 g Plain flour; (8oz)|8 Eggs|570 ml Milk; (1pint)|50 g Good dripping; (2oz)|2 White onions|250 ml Red wine; (9fl oz)|400 ml Beef stock; (14fl oz)|Seasoning', 'servings': '1 servings', 'instructions': 'Firstly place the flour and some seasoning in a bowl and add some eggs mixing in with a whisk and then the milk, slowly, to stop lumps from forming. At this point you should place this in the fridge overrnight covered with some clingfilm. Place the non-stick yorkshire tins into the oven on a very high heat with a little dripping in each of the tins. Before adding the mix to the tins prepare the salmon by skinning and cutting the fillet onto small dice and add to the mixture. The tins should be smoking hot as you pour the the mix full to the the top ~ the mix should seal the edges. Working fast, place back in the oven on a high heat and close the door and leave closed for about 20 minutes. While this is cooking, peel and slice the onions and cook to death (caramelise well) in a pan. Add the wine and stock and reduce well until thickened, season. Turn down the oven by 40øC and cook for another 10 minutes - to cook the bottam. Remove from the oven and serve the thick onion gravy in the middle.'}, {'title': 'Grappa-Cured Salmon with Crushed Grapefruit Crostini', 'ingredients': '1/2 c Kosher salt; plus|2 tb Kosher salt; for grapefruit|1/2 c Sugar; plus|4 tb Sugar; for grapefruit|2 tb Dry thyme leaves|2 tb Freshly-ground black pepper|1 tb Crushed red pepper flakes|1 Tail piece of fresh salmon - (10 to 12 oz); skin on, bones|Removed|2 oz Grappa|1/2 sm Grapefruit|1/4 c Extra-virgin olive oil|12 sl Ficelle - (1/4\" thick); lightly toasted in|Oven', 'servings': '4 servings', 'instructions': 'Twenty-four hours in advance stir together in a bowl salt, sugar, thyme, black pepper and red pepper flakes until well blended. Place salmon skin-side down in a baking dish and cover with 1/2 the salt mixture. Pour the grappa down the center of the fish. Add remaining salt mixture over fish and cover the entire dish with plastic wrap. Refrigerate for 24 hours. Remove fish from refrigerator and rinse salmon under cold water to remove salt, then pat dry. Remove seeds from the grapefruit. Chop roughly and place grapefruit pieces and skin into blender with 4 tablespoons of sugar, 2 tablespoons of salt and extra-virgin olive oil. Blend until smooth and set aside. Using a sharp slicing knife, slice cured salmon on bias into 1-inch wide paper-thin slices and place like carpaccio among 4 plates. Place 1 teaspoon grapefruit mixture over each piece of toasted ficelle and place 3 on each plate. Serve immediately. This recipe yields 4 servings.'}, {'title': 'Grill Smoked Salmon with Chipotle Mayonaise (Dj/zm)', 'ingredients': '2 Sides of a 6 to 9 pound salmon; skin on|1/2 c Chipotle paste; or to taste|Salt; to taste|2 tb Olive oil; or as needed (up to 4)|1 c Mayonesa de chipotle; recipe follows|Jicama escabechada; recipe follows', 'servings': '8 servings', 'instructions': 'Run your fingers over salmon to find any pin bones and pull them out with tweezers. Brush the paste over salmon on both sides. Use full amount for spiciest effect, less for milder flavor. Sprinkle over salmon on both sides. Season with salt to taste. Brush with olive oil and let rest at room temperature at least 15 minutes before grilling. Add some mesquite chips of a small piece of wood to the coals; when it starts smoking, place the salmon on the grill, skin side down. Cover with a baking tray or disposable roasting pan to trap smoke. Cook for approximately 6 to 7 minutes on each side. The outside should be nice and brown, the center just barely cooked (very slightly translucent). Serve at room temperature with Mayonesa de Chipotle and Jicama Escabechada. Yield: 8 to 10 servings PASTA DE CHIPOTLE (CHIPOTLE PASTE) 1 can (8 ounces) Chiles Chipotles en Abode 4 to 5 garlic cloves, minced (about 2 tablespoons) 1 tablespoon dried Mexican oregano 2 tablespoons vegetable oil or olive oil Place the chipotle chiles and their sauce in a blender or food processor fitted with the steel blade. Process until pureed, about 1 minute. Add the garlic, oregano, oil, and process on pulse until combined but still slightly chunky. Yield:1 cup MAYONESA DE CHIPOTLE (CHIPOTLE MAYONAISE) 1 cup commercially prepared mayonnaise 3 tablespoons Pasta de Chipotle, or to taste, see recipe above Salt, to taste Combine mayonnaise and chipotle paste. Taste for seasoning and add salt if desired. Refrigerate unless using at once. Yield: 1 cup JICAMA ESCABECHADA (JICAMA RELISH) 1 small carrot, peeled and finely diced 1 small zucchini, scrubbed and finely diced 1 medium Jicama, peeled and finely diced 1 medium onion, finely chopped, (about 1 cup) 4 garlic cloves, minced 1 tablespoon Chipotle paste 1 bay leaf 6 black peppercorns 1 teaspoon salt, or to taste 1/2 teaspoon dried Mexican oregano, crumbled 2 tablespoons chopped fresh cilantro leaves 1/2 cup distilled white vinegar 1/2 cup water 1/3 cup extra virgin olive oil Blanch the diced carrot in boiling water for 2 to 3 minutes. Drain thoroughly. Place all the ingredients in an earthenware or glass bowl and toss to combine. Let marinate, refrigerated, at least 4 hours or preferably overnight. Serve at room temperature.'}, {'title': 'Honey Soy Baked Salmon', 'ingredients': '4 Salmon fillets|1/2 c Golden Dipt Fat Free Honey Soy Marinade', 'servings': '4 Servings', 'instructions': 'Place salmon fillets in shallow dish. Pour marinade over fillets and refrigerate 15 minutes. preheat oven to 425. Bake salmon fillets 8-10 minutes per inch of thickness or until fish flakes easily with a fork. Serves 4.'}]}",
